import React from 'react';
import Grid from '@material-ui/core/Grid';
import { SearchResults } from '../../organisms';
import { BasicLayout } from '../../layout';

export const SearchResultsScreen = () => {
  return (
    <BasicLayout>
      <Grid container>
        <Grid item xs={12} sm={12}>
          <SearchResults/>
        </Grid>
      </Grid>
    </BasicLayout>
  );
};
